import React, { useState } from 'react';
import './viewBooking.css';

const ViewBooking = () => {
  const [selectedBooking, setSelectedBooking] = useState(null);
  const currentDate = new Date().toLocaleDateString('vi-VN', {
    day: '2-digit',
    month: '2-digit',
    year: 'numeric',
  });

  const bookingList = [
    {
      id: 1,
      patientName: 'Nguyễn Văn A',
      reason: 'Đau bụng',
      date: currentDate,
      time: '08:00',
    },
    {
      id: 2,
      patientName: 'Trần Thị B',
      reason: 'Sốt cao',
      date: currentDate,
      time: '09:30',
    },
    {
      id: 3,
      patientName: 'Lê Văn C',
      reason: 'Đau họng',
      date: currentDate,
      time: '11:15',
    },
    {
      id: 4,
      patientName: 'Phạm Thị D',
      reason: 'Mất ngủ',
      date: currentDate,
      time: '14:00',
    },
    {
      id: 5,
      patientName: 'Nguyễn Thanh E',
      reason: 'Đau lưng',
      date: currentDate,
      time: '15:45',
    },
    {
      id: 6,
      patientName: 'Trần Văn F',
      reason: 'Sổ mũi',
      date: '02/07/2023',
      time: '10:30',
    },
    {
      id: 7,
      patientName: 'Lê Thị G',
      reason: 'Đau răng',
      date: '02/07/2023',
      time: '12:45',
    },
    {
      id: 8,
      patientName: 'Nguyễn Văn H',
      reason: 'Sưng nước mắt',
      date: '02/07/2023',
      time: '16:30',
    },
    {
      id: 9,
      patientName: 'Phạm Thị I',
      reason: 'Đau khớp',
      date: '02/07/2023',
      time: '17:45',
    },
    {
      id: 10,
      patientName: 'Trần Văn J',
      reason: 'Buồn nôn',
      date: '02/07/2023',
      time: '18:30',
    },
    {
      id: 11,
      patientName: 'Hoàng Thị K',
      reason: 'Mệt mỏi',
      date: '03/07/2023',
      time: '09:00',
    },
    {
      id: 12,
      patientName: 'Vũ Văn L',
      reason: 'Chảy máu chân',
      date: '03/07/2023',
      time: '11:30',
    },
    {
      id: 13,
      patientName: 'Nguyễn Thị M',
      reason: 'Đau đầu',
      date: '03/07/2023',
      time: '13:15',
    },
    {
      id: 14,
      patientName: 'Phạm Văn N',
      reason: 'Sưng hạch',
      date: '03/07/2023',
      time: '15:30',
    },
    {
      id: 15,
      patientName: 'Trần Thị O',
      reason: 'Rối loạn tiêu hóa',
      date: '03/07/2023',
      time: '16:45',
    },
    {
      id: 16,
      patientName: 'Lê Văn P',
      reason: 'Mất trí nhớ',
      date: '04/07/2023',
      time: '08:30',
    },
    {
      id: 17,
      patientName: 'Nguyễn Thị Q',
      reason: 'Khó thở',
      date: '04/07/2023',
      time: '10:45',
    },
    {
      id: 18,
      patientName: 'Phạm Văn R',
      reason: 'Đau mắt',
      date: '04/07/2023',
      time: '13:00',
    },
    {
      id: 19,
      patientName: 'Trần Thị S',
      reason: 'Đau ngực',
      date: '04/07/2023',
      time: '15:15',
    },
    {
      id: 20,
      patientName: 'Nguyễn Thanh T',
      reason: 'Đau lưng',
      date: '04/07/2023',
      time: '19:30',
    },
  ];

  const handleViewBooking = (booking) => {
    setSelectedBooking(booking);
  };

  return (
    <div className="view-booking">
      <h2 className="section-title">Lịch khám hôm nay ({currentDate})</h2>
      <ul className="booking-list">
        {bookingList
          .filter((booking) => booking.date === currentDate)
          .map((booking) => (
            <li
              key={booking.id}
              className={`booking-item ${selectedBooking === booking ? 'selected' : ''}`}
              onClick={() => handleViewBooking(booking)}
            >
              <span className="patient-name">{booking.patientName}</span>
              <span className="booking-details">
                <span className="booking-info">Lý do: {booking.reason}</span>
                <span className="booking-info">Thời gian: {booking.time}</span>
              </span>
            </li>
          ))}
      </ul>
      {selectedBooking && (
        <div className="selected-booking">
          <h3 className="section-title">Thông tin phiếu khám</h3>
          <p className="patient-name">{selectedBooking.patientName}</p>
          <p className="booking-info">Lý do: {selectedBooking.reason}</p>
          <p className="booking-info">Ngày: {selectedBooking.date}</p>
          <p className="booking-info">Thời gian: {selectedBooking.time}</p>
        </div>
      )}
    </div>
  );
};

export default ViewBooking;
